fieldValues.fieldValue:
={{(() => {
  const existingLeads = ($json.csv_cache && Array.isArray($json.csv_cache)) ? $json.csv_cache : [];
  const newLeads = $('Edit fields').all().map(item => ({
    "first_name": item.json.first_name,
    "last_name": item.json.last_name,
    "linkedin_url": item.json.linkedin_url,
    "company_url": item.json.company_url,
    "email": item.json.email,
    "job_title": item.json.job_title,
    "company": item.json.company,
    "location": item.json.location,
    "company_headcount": item.json.company_headcount,
    "company_industry": item.json.industry,
    "phone_number": item.json.phone_number,
    "company_linkedin_url": item.json.company_linkedin_url
  }));

  // Get existing emails to avoid duplicates
  const existingEmails = new Set(existingLeads.map(lead => lead.email));

  // Filter out leads that already exist
  const uniqueNewLeads = newLeads.filter(lead => 
    !existingEmails.has(lead.email)
  );

  // Return combined array
  return [...existingLeads, ...uniqueNewLeads];
})()
}}
